import React, { useEffect, useState } from 'react'
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import MenuItem from '@mui/material/MenuItem';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Button from '@mui/material/Button';

import {Formik,Form,Field} from 'formik'
import Dialog from '@mui/material/Dialog';
import DialogTitle from '@mui/material/DialogTitle';
import DialogContent from '@mui/material/DialogContent';
import DialogActions from '@mui/material/DialogActions';
import IconButton from '@mui/material/IconButton';
import CloseIcon from '@mui/icons-material/Close';
import Typography from '@mui/material/Typography';
import InteviewPortal from './InteviewPortal';
import axios from 'axios';
import { FormControl, InputLabel, Select } from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import EditIcon from '@mui/icons-material/Edit';
//button/-----
const BootstrapDialog = styled(Dialog)(({ theme }) => ({
    '& .MuiDialogContent-root': {
      padding: theme.spacing(2),
    },
    '& .MuiDialogActions-root': {
      padding: theme.spacing(1),
    },
  }));


const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
      backgroundColor: '#1976d2',
      color: theme.palette.common.white,
    },
    [`&.${tableCellClasses.body}`]: {
      fontSize: 14,
    },
  }));
  
  const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.action.hover,
    },
    // hide last border
    '&:last-child td, &:last-child th': {
      border: 0,
    },
  }));
  
 
const SubCatagary = () => {
     const [open, setOpen] = React.useState(false);
     const [catId,setcatId] = useState('')
    
        const handleClickOpen = () => {
          setOpen(true);
        };
        const handleClose = () => {
          setOpen(false);
        };
        const [ini,setIni] = useState({
          subCategoryname:'',
          categoryID:''
        })
        const [list,setList]=useState([]) //catagary list mate
        const [list1,setList1]=useState([])  //subcatagarylist mate
        const [editId,setEditId]=useState(null)
    const handleSubmit=(values,{resetForm})=>{
      values.categoryID = catId
      // console.log("===>",values);
      if(editId != null){
          <axios className="patch"></axios>

      }
      else
      {
          axios
      .post('https://interviewback-ucb4.onrender.com/subcategory/create',values,{
        headers:{
          Authorization: "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY3ODA4YTE3MzRkZGY2ZjZlZGUyNTRmMSIsImlhdCI6MTc0MjgwNTc0MX0.xbzSgCvGkLI6G-AJ5zU-vZfl78fsePVv69XXS6HQkOU"
        }
      })
      .then(()=>{
        console.log('succes')
        dataView()
      })
      .catch((error)=>{
        console.log(error)
      })
      resetForm()
    }
  }
    function dataView(){
      axios
      .get('https://interviewback-ucb4.onrender.com/subcategory/',{
        headers: {
          Authorization:"eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY3ODA4YTE3MzRkZGY2ZjZlZGUyNTRmMSIsImlhdCI6MTc0Mjc5Njg3OX0.VhjRg_oGm9skgXMpeoVr5BzXF_1CYCdgaGYn8WCL_aM"
        }
      })
      .then((res)=>{
        console.log(res.data.data)
        setList1(res.data.data)

      })
      .catch((error)=>{
        console.log(error)
      })
    }

    const handleFillcatagary=()=>{
      axios.get('https://interviewback-ucb4.onrender.com/category/',{
        headers:{
          Authorization:"eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY3ODA4YTE3MzRkZGY2ZjZlZGUyNTRmMSIsImlhdCI6MTc0MjYyMDUwM30._S8-zRqSVebO8IljXmp3vSa-IOpV2_bp-USjSzuVFP8"
        }
      })
      .then((res)=>{
        console.log(res.data.data);
        setList(res.data.data)
      })
      .catch((err)=>{
        console.log(err);
        })
    }

    const deleteData=(id)=>{
      axios.delete(`https://interviewback-ucb4.onrender.com/subcategory/${id}`,{
        headers:{
          Authorization:"eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY3ODA4YTE3MzRkZGY2ZjZlZGUyNTRmMSIsImlhdCI6MTc0Mjg4MTY0OH0.c3cdoNzxbcAwcYhwJL5iTEFVPXOXBY9wA0-kUWjbwo0"
        }
      })
      .then(()=>{
        console.log('delete succes');
        dataView()
        
      })
      .catch((error)=>{
        console.log(error);
      })
    }

    const editData=(id,row)=>{
      handleClickOpen()
      setEditId(id)
      setIni(row)
    }
    useEffect(()=>{
      dataView()
      handleFillcatagary()
    },[])

    const handleChange=(e) => {

      // console.log("check",e);
      
      setcatId(e.target.value)
    }

    
  return (
    <>
    <InteviewPortal>
    <Box sx={{width:'100%',display:'flex',flexWrap:{lg:'no-wrap',md:'wrap',sm:'wrap',xs:'wrap'}}}>
    <Box
      component="form"
      sx={{    width: {lg:'80% ',md:'100%',sm:'100%',xs:'100%'}}}
   
      noValidate
      autoComplete="off"
   
    >
      <div>
        <TextField
          id="outlined-select-currency"
          select
          label="Search Catagary"
          sx={{width:'100%'}}
        >
          {/* {currencies.map((option) => (
            <MenuItem key={option.value} value={option.value}>
              {option.label}
            </MenuItem>
          ))} */}
        </TextField>
       
      </div>
 
    </Box>
    {/* button add catagary------------------------------------------------ */}
    <Box sx={{  width: {lg:'20% ',md:'100%',sm:'100%',xs:'100%'},justifyContent:'center',display:'flex',padding: '10px 0px ' }}>
    <React.Fragment>
      <Button  sx={{backgroundColor:'#1976d2',color:'white',width:'100%'}}variant="outlined" onClick={handleClickOpen}>
       ADD  SUB-CATAGARY
      </Button>
      <BootstrapDialog
        onClose={handleClose}
        aria-labelledby="customized-dialog-title"
        open={open}
      >
        <DialogTitle sx={{ m: 0, p: 2 }} id="customized-dialog-title">
         Add Catagary
        </DialogTitle>

        
        <IconButton
      
          aria-label="close"
          onClick={handleClose}
          sx={(theme) => ({
            position: 'absolute',
            right: 8,
            top: 8,
            color: theme.palette.grey[500],
          })}
        >
          <CloseIcon />
        </IconButton>
        <Formik
        enableReinitialize
        initialValues={ini}
        onSubmit={handleSubmit}
        >
        <Form>
        <DialogContent dividers sx={{display:'flex',flexDirection:'column'}}>
                <Field as={TextField} name="subCategoryname" label='subcategory'></Field>
                {/* <Field as={TextField} name="categoryID" label='category'></Field> */}

      <FormControl fullWidth>
        <InputLabel id="demo-simple-select-label">category</InputLabel>
        <Select
         name="categoryID" label='category'
          onChange={(e) => handleChange(e)}
          value={catId}
        >
         {
          list.map((row ) => (
            <MenuItem value={row._id}>{row.categoryName}</MenuItem>
            ))
        }            
        </Select>
      </FormControl>
                
        <DialogActions>
          <Button   sx={{backgroundColor:'#1976d2',color:'white'}}autoFocus type='submit'>
            Submit
          </Button>
        </DialogActions>
        </DialogContent>
        </Form>
         </Formik>
      </BootstrapDialog>
    </React.Fragment>
    </Box>
    </Box>

    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 700, }} aria-label="customized table">
        <TableHead >
          <TableRow >
            <StyledTableCell >No.</StyledTableCell>
            <StyledTableCell align="left">Sub-Catagary Name</StyledTableCell>
            <StyledTableCell align="left">Catagary Name</StyledTableCell>
            <StyledTableCell align="right">Status</StyledTableCell>
            <StyledTableCell align="right">Update</StyledTableCell>
            <StyledTableCell align="right">Delete</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {list1.map((row,i) => (
            <StyledTableRow key={i}>
              <StyledTableCell component="th" scope="row">
                {i+1}
              </StyledTableCell>
              <StyledTableCell align="left">{row.subCategoryname}</StyledTableCell>
              <StyledTableCell align="left">{row.categoryID?.categoryName}</StyledTableCell>
              <StyledTableCell align="right">{row.status}</StyledTableCell>
              <StyledTableCell align="right">
              <button onClick={()=>editData(row._id,row)}><EditIcon/></button>
                </StyledTableCell>
              <StyledTableCell align="right">
              <button onClick={()=>deleteData(row._id)}><DeleteIcon/></button>
                </StyledTableCell>
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    </InteviewPortal>
   </>
  )
}

export default SubCatagary
